const customTheme = createMuiTheme({
    pallete: {
        primary: {
            main: purple[500]
        }
    },
})

function App() {
    return (
        <ThemeProvider theme={customTheme}>
            <div className="App">
                <Button variant="contained" color="primary">Hello World</Button>
            </div>
        </ThemeProvider>
  );
}

export default App;
